var child_process = require('child_process');

var Crawler = function() {
  this.batch_size = 10;
  this.slaves_n = 1;
  this.urls = [];
  this.slaves = [];
  this.url_page = 0;
}

Crawler.prototype.set_urls = function(x) {
  this.urls = x;

  return this;
}

Crawler.prototype.set_slaves = function(n) {
  this.slaves_n = n;

  return this;
}

Crawler.prototype.set_batch_size = function(n) {
  this.batch_size = n;

  return this;
}

Crawler.prototype.run_crawler = function(slave_index) {
  var _this = this;


  var start_slice = (this.url_page * this.batch_size);
  var end_slice = start_slice + this.batch_size;

  var batch = '"' + this.urls.slice(start_slice, end_slice).join(',') + '"';

  this.slaves[slave_index] = child_process.exec('node parse.js ' + batch, function(error, stdout, stderr) {
    console.log(stdout);
    if (error) {
      console.log(error.stack);
      console.log('Error code: ' + error.code);
      console.log('Signal received: ' + error.signal);
    }
  });

  this.slaves[slave_index].on('exit', function(code) {
    _this.run_crawler(slave_index);
    console.log('Parsed', code);
  });

  this.url_page++;
}

Crawler.prototype.run = function() {
  for (i = 0; i < this.slaves_n; i++) {
    console.log('Starting crawler process');
      this.run_crawler()
  }
}



